import React from 'react';
import styled from 'styled-components';

import Header from '../header/header';

const Container = styled.div`
  ${'' /* height: 100vh; */}
  ${'' /* overflow: hidden; */}

  background: green;
  min-height: 100vh;
`;

function Layout(props) {
  return (
    <Container>
      <Header />
      {props.children}
    </Container>
  );
}

export default Layout;
